    <div className='body'>
      <div className='main'>
      
      <img src="https://www.okayplayer.com/media-library/photo-by-jakub-dziubak-for-unsplash.jpg?id=46471783&width=1245&height=700&quality=90&coordinates=0%2C0%2C0%2C158"
     alt='err'
     style={{
        width:"1200px",
        height:"600px"
      }}
      ></img>
